import React from "react";

import Grid from "@mui/material/Grid";
import { Box } from "@mui/material";
import "../NavBar/"

const Dashboard = () => {
  return (
    <div>
      <Box sx={{ flexGrow: 1 }}>
        <Grid container column>
          <Grid sx={4}>Deposit</Grid>
          <Grid sx={4}>Withdraw</Grid>
          <Grid sx={4}>Account</Grid>
        </Grid>
      </Box>
    </div>
  );
};

export default Dashboard;
